// import './boxcomp.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEdit } from '@fortawesome/free-solid-svg-icons'; // Import the edit icon
// import './boxcomp.css'

const ProjectComponent = (props) => {
    const {data} = props
    const {project, industry_domains,funnel_stages, project_role , project_type} = data 
    return (
        <div className="w-full min-w-[250px] max-w-[300px] h-full min-h-[150px] max-h-[200px] flex flex-col justify-evenly bg-[lightblue] m-4 p-2 rounded-2xl">
                    <div className='flex justify-between'>
                        <h1 className='text-base'>{project}</h1>
                        <FontAwesomeIcon icon={faEdit} className='text-[darkblue] self-center' />
                    </div>
                    <h1 className='text-[0.8rem] text-[blueviolet]'>{industry_domains}</h1>
                    <h1 className='text-[0.8rem] text-[blueviolet]'>{funnel_stages}</h1>
                    <div className='flex justify-between'>
                        <h1 className='text-base'>{project_role}</h1>
                        <h1 className='text-base'>{project_type}</h1>
                    </div>
        </div>
    )
}

export default ProjectComponent
